import React from "react";
import { items } from "../data";
import Product from "./Product";

const Products = () => {
  // const products = { items };
  console.log(items);
  return (
    <div>
      <hr />
      {items.map(item => {
        return <Product item={item} />;
      })}
    </div>
  );
};

export default Products;
